import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/SGODashboard.css';
import Card from './Card';

export default function SGODashboard() {
  const navigate = useNavigate();

  const addCSO = () => {
    navigate('/addCSO');
  };

  const back = () => {
    navigate('/SGO');
  };

  function cards() {
    return (
      <>
        <section className="card-container">
          <Card imageUrl="../images/clubs.png" description="Students" />
          <Card imageUrl="../images/clubs.png" description="Executives" />

          <Card
            imageUrl="../images/clubs.png"
            description="CSOs"
            onClick={() => navigate('/CSO')}
          />
        </section>
      </>
    );
  }

  return (
    <main>
      <h1>Clubs, Societies, and Organizations</h1>
      <p>Modify, add, and delete CSOs.</p>
      <button onClick={addCSO}>Add CSO</button>
      <button onClick={back}>Back</button>
      {cards()}
    </main>
  );
}
